      const todos = await res.json();

      setMessage(todos.msg)
      console.log(todos);
    };
    getTodos();
  },[])

  return (
    <main className="container">
      <h1>MERN Todo</h1>
      <div>
        {(todos.length > 0) && <pre>{JSON.stringify(todos, null, 2)}</pre>}
